import React from 'react';
import {
  MDBInput,
  MDBCol,
  MDBRow,
  MDBCheckbox,
  MDBBtn,
  MDBIcon,
  MDBTextArea
} from 'mdb-react-ui-kit';
import Container from 'react-bootstrap/Container';
import Col from 'react-bootstrap/Col';
import Row from 'react-bootstrap/Row';
import Form from 'react-bootstrap/Form'
import Button from 'react-bootstrap/Button'

// <MDBInput id='form3Example1' label='First name' />
// <MDBIcon fab icon='facebook-f' />
export default function Contact() {
  return (
    <section className ='contact-section' >
        <h1 className='Poppins contact-section-header'>Get in touch</h1>
        <Container fluid className='contact-me-container ' >

       

       
        
             <Form className='m-auto text-center' style={{width:'50%'}} >

                <Form.Group className="mb-4">
                  <Form.Label>First Name</Form.Label>
                  <Form.Control className = 'm-auto' type="email" placeholder="Enter First Name" style={{width:'50%'}} />
                </Form.Group>
                
                <Form.Group className="mb-4" controlId="formBasicPassword">
                  <Form.Label>Password</Form.Label>
                  <Form.Control className = 'm-auto' type="password" placeholder="Password" style={{width:'50%'}}  />
                </Form.Group>
                <br /><br />
                <Button variant="primary" type="submit">
                  Submit
                </Button>

              </Form>

      





       
          

          

        </Container>
    </section>
   
  );
}
